  const [ todoItemList, setTodoItemList ] = useState([]);

  return (
    <div>
      <h1>오늘 할 일은?</h1>
      <TodoListTemplate
        todoList={<TodoItemList
          todoItemList={todoItemList}
        />}
        todoForm={<TodoForm

        />}
      >
      </TodoListTemplate>
    </div>
  );
}

export default App;
